decoNote.p:
Skrautlegir upphafsstafir í upphafi undirkafla. Sumir eru nokkuð stórir og skreyttir á svipaðan hátt og upphafsstafir þáttanna (t.d. F á bl. 28ra
og E á bl. 61ra
). Aðrir eru minni en þó töluvert skreyttir; bryddaðir eða fylltir með smátenntum laufum og hnúðum á sveigðum teinum sem dregnir eru með öðrum lit en stafurinn sjálfur (t.d. bl. 7v
). Fyrir þessa stafi eru dregnar inn tvær eða þrjár línur.

Einfaldir upphafsstafir í upphafi undirkafla. Sumir eru aðeins litdregnir, með rauðbrúnu, blágrænu, ólífugrænu eða gulu bleki, og óskreyttir (t.d. bl. 26v
og 52v
). Aðrir eru einungis lítillega skreyttir með einföldum pennadráttum eða flúrkrullum í sama eða öðrum lit (t.d. bl. 52v
). Þessir stafir eru dregnir í tveggja línu reiti (einstaka í þriggja línu reiti). Á stöku stað eru auðir reitir fyrir upphafsstafi sem þessa (t.d. bl. 22r
).

Mjög víða spássíutákn í formi handa með bendandi fingur (t.d. bl. 9v
og 50r
).

additions.p:
Fremst hafa verið fest tvö pappírsblöð og er þar á tveimur og hálfri síðu uppskrift (frá lokum 17. aldar
, með hendi Ásgeirs Jónssonar
) af fyrstu síðu skinnbókarinnar.
